INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, "トゥインクルウィッシュ", 155, "人助け、応援", 2, "獣人族", "東山奈央", 0, "ヒヨリ", 100101, 16, 44, "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, "トゥインクルウィッシュ", 158, "料理、人間観察", 2, "ヒューマン", "種田梨沙", 0, "ユイ", 100201, 17, 47, "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, "トゥインクルウィッシュ", 163, "読書、乗馬、お茶", 2, "魔族", "早見沙織", 0, "レイ", 100301, 18, 46, "クールで何事にも真っ直ぐな剣士");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 8, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 10, "リトルリリカル", 128, "いたずら、探検", 5, "ヒューマン", "諸星すみれ", 0, "ミソギ", 100401, 9, 27, "探検好きのイタズラっ子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 11, "？？？", 25, "王宮騎士団（NIGHTMARE）", 146, "ヒーローごっこ", 8, "獣人族", "下田麻美", 0, "マツリ", 100501, 12, 40, "ヒーローに憧れる騎士見習いの少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 11, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 22, "悪魔偽王国軍（ディアボロス）", 150, "サックス", 7, "魔族", "浅倉杏美", 0, "アカリ", 100601, 13, 42, "甘え上手なみんなの人気者");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, "悪魔偽王国軍（ディアボロス）", 130, "プリンを食べること", 7, "魔族", "雨宮天", 0, "ミヤコ", 100701, 14, 32, "プリン大好きゴースト娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, "ヴァイスフリューゲル　ランドソル支部", 150, "鏡で自分を見ること", 15, "エルフ", "大空直美", 0, "ユキ", 100801, 14, 40, "ボクは誰よりも美しい");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 5, "トワイライトキャラバン", 159, "小説執筆", 13, "魔族", "髙野麻美", 0, "アンナ", 100901, 17, 45, "前世を信じる中二病患者、「疾風の冥姫」");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 22, "自警団（カォン）", 155, "空想、ぬいぐるみ集め", 10, "獣人族", "内田真礼", 0, "マホ", 101001, 16, 42, "マホマホ王国のプリンセス");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 8, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 25, "ラビリンス", 156, "お裁縫", 3, "ヒューマン", "阿澄佳奈", 0, "リノ", 101101, 15, 44, "人懐っこくてマシンガントークな妹系少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 12, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 24, "フォレスティエ", 156, "妹と遊ぶこと、二度寝、昼寝、早寝", 6, "エルフ", "大橋彩香", 0, "ハツネ", 101201, 17, 46, "みんなのために超能力を使う眠り姫");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 8, "", 21, "トワイライトキャラバン", 166, "読書、魔法", 13, "魔族", "佳村はるか", 0, "ナナカ", 101301, 18, 55, "オタク全開な魔法少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 11, "test", 3, "自警団（カォン）", 152, "読書、推理", 10, "獣人族", "水瀬いのり", 0, "カスミ", 101401, 15, 41, "頭脳明晰な美少女名探偵");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 9, "test", 5, "フォレスティエ", 165, "絵本作り", 6, "エルフ", "國府田マリ子", 0, "ミサト", 101501, 21, 54, "母性溢れる優しいみんなの「ミサト先生」");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 4, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 10, "ルーセント学院", 167, "ファッション", 14, "魔族", "上坂すみれ", 0, "スズナ", 101601, 18, 48, "天真爛漫で人気者のカリスマモデル");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, "自警団（カォン）", 158, "踊り、空手", 10, "獣人族", "高森奈津美", 0, "カオリ", 101701, 19, 53, "いつでも「なんくるないさ～」な天然娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 8, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 14, "ルーセント学院", 162, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 14, "魔族", "伊藤静", 0, "イオ", 101801, 23, 52, "多くの男性を魅了する無垢な女教師");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 4, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 3, "リトルリリカル", 117, "かわいいもの集め", 5, "獣人族", "日高里菜", 0, "ミミ", 102001, 10, 21, "お歌もにんじんも、ウサギさんも大好き♪");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "サレンディア救護院", 150, "観劇、おままごと", 9, "ヒューマン", "植田佳奈", 0, "クルミ", 102101, 12, 40, "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 11, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 22, "悪魔偽王国軍（ディアボロス）", 150, "ゲーム全般", 7, "魔族", "原紗友里", 0, "ヨリ", 102201, 13, 40, "人見知りであまのじゃくな女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, "サレンディア救護院", 148, "屋内でできる遊び", 9, "ヒューマン", "芹澤優", 0, "アヤネ", 102301, 14, 38, "ぷうきちといつも一緒！");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, "サレンディア救護院", 154, "ご奉仕", 9, "ヒューマン", "悠木碧", 0, "スズメ", 102501, 15, 43, "お嬢さまのためにがんばるドジっ娘メイド");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 1, "test", 1, "牧場（エリザベスパーク）", 144, "あんパン", 11, "獣人族", "小岩井ことり", 0, "リン", 102601, 17, 42, "遊びと睡眠が何より大事なぐうたら娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, "トワイライトキャラバン", 154, "実験、裁縫、料理", 13, "魔族", "橋本ちなみ", 0, "エリコ", 102701, 16, 43, "運命の相手に一途すぎる乙女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 10, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 4, "サレンディア救護院", 156, "経営、お茶会", 9, "エルフ", "堀江由衣", 0, "サレン", 102801, 17, 43, "救護院を経営する優しい庶民派お嬢様");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 1, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 24, "カルミナ", 157, "舞台鑑賞、ダンス", 4, "ヒューマン", "日笠陽子", 0, "ノゾミ", 102901, 17, 40, "歌って踊れる大人気アイドル");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 31, "ヴァイスフリューゲル　ランドソル支部", 163, "忍法開発", 15, "ヒューマン", "佐藤聡美", 0, "ニノン", 103001, 16, 51, "トーゴクの神秘、オシエテクダサイ！");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, "悪魔偽王国軍（ディアボロス）", 157, "占い", 7, "魔族", "大坪由佳", 0, "シノブ", 103101, 18, 42, "占いが得意な霊能少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 3, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 12, "メルクリウス財団", 157, "慈善事業", 12, "ヒューマン", "松嵜麗", 0, "アキノ", 103201, 18, 45, "一人前の商人を目指すパワフルお嬢様");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, "牧場（エリザベスパーク）", 142, "漫才", 11, "ヒューマン", "新田恵海", 0, "マヒル", 103301, 20, 35, "みんなを笑顔にするお笑い牧場主");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 3, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 16, "メルクリウス財団", 164, "ウインドーショッピング", 12, "エルフ", "今井麻美", 0, "ユカリ", 103401, 22, 55, "純情でほっとけない大人の女性");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 2, "test", 2, "リトルリリカル", 118, "お勉強", 5, "エルフ", "小倉唯", 0, "キョウカ", 103601, 8, 21, "礼儀正しくしっかり者のちびっ子優等生");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 8, "test", 11, "王宮騎士団（NIGHTMARE）", 149, "剣術、年長者をからかう", 8, "ヒューマン", "茅原実里", 0, "トモ", 103701, 13, 43, "義理堅くてからかい好きな剣術少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 3, "牧場（エリザベスパーク）", 153, "読書、お散歩", 11, "獣人族", "小清水亜美", 0, "シオリ", 103801, 14, 40, "読書が趣味の病弱少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, "フォレスティエ", 158, "友達作りのイメトレ", 6, "エルフ", "花澤香菜", 0, "アオイ", 104001, 13, 44, "「友達」に憧れる、エルフの森の女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, "カルミナ", 163, "各種楽器", 4, "ヒューマン", "福原綾香", 0, "チカ", 104201, 17, 46, "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 8, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 9, "自警団（カォン）", 168, "お菓子作り", 10, "獣人族", "小松未可子", 0, "マコト", 104301, 17, 54, "男勝りで情に厚いワイルド娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 5, "test", 5, "悪魔偽王国軍（ディアボロス）", 172, "世界征服", 7, "魔族", "丹下桜", 0, "イリヤ", 104401, "??", 50, "かつては夜を支配した最強の吸血鬼");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 19, "ヴァイスフリューゲル　ランドソル支部", 157, "小説を読むこと", 15, "ヒューマン", "長妻樹里", 0, "クウカ", 104501, 18, 49, "妄想大好き！　ほんとは照れ屋な女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 1, "メルクリウス財団", 158, "猫とたわむれること", 12, "獣人族", "沼倉愛美", 0, "タマキ", 104601, 18, 48, "弱きを助け強きをくじく猫娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 10, "？？？", 25, "王宮騎士団（NIGHTMARE）", 171, "格闘技、湯浴み", 8, "ヒューマン", "川澄綾子", 0, "ジュン", 104701, 25, 50, "素顔を見せない冷静沈着な女性騎士");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "メルクリウス財団", 163, "傭兵などのアルバイト", 12, "ヒューマン", "田所あずさ", 0, "ミフユ", 104801, 20, 49, "仕事も私事も効率優先な傭兵少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 24, "ラビリンス", 168, "家事全般", 3, "ヒューマン", "生天目仁美", 0, "シズル", 104901, 18, 54, "お姉ちゃんがお世話してあげるからねっ！");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 3, "ルーセント学院", 120, "ファッション誌鑑賞、コスメ集め", 14, "魔族", "久野美咲", 0, "ミサキ", 105001, 11, 22, "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 7, "トワイライトキャラバン", 166, "研究、実験", 13, "ヒューマン", "三石琴乃", 0, "ミツキ", 105101, 27, 53, "実験が趣味の危険な科学者");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 3, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 14, "牧場（エリザベスパーク）", 150, "毛繕い、お喋り", 11, "獣人族", "徳井青空", 0, "リマ", 105201, 18, 100, "乙女チックなもふもふアニマル");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 7, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 28, "ヴァイスフリューゲル　ランドソル支部", 140, "お菓子屋通い", 15, "ヒューマン", "辻あゆみ", 0, "モニカ", 105301, 18, 33, "見た目も中身もお子ちゃまな異国の軍人");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 9, "test", 7, "カルミナ", 153, "裁縫", 4, "ヒューマン", "木戸衣吹", 0, "ツムギ", 105401, 14, 45, "ファッション大好きなキュートガール");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 4, "test", 7, "ヴァイスフリューゲル　ランドソル支部", 155, "観察", 15, "エルフ", "大関英里", 0, "アユミ", 105501, 16, 43, "どこまでも一途に慕う、純情乙女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 7, "test", 11, "トワイライトキャラバン", 167, "釣り", 13, "ヒューマン", "佐藤利奈", 0, "ルカ", 105601, 25, 54, "人情味溢れる粋でいなせな「姉御」");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 3, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", 10, "？？？", 156, "冒険、おしゃべり", "", "ヒューマン", "金元寿子", 0, "ジータ", 105701, 17, 45, "空への冒険を夢見る騎空士の少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 3, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 31, "美食殿", 156, "食べ歩き、料理", 1, "ヒューマン", "M・A・O", 0, "ペコリーヌ", 105801, 17, 46, "いつも元気な腹ペコ少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 5, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 11, "美食殿", 140, "瞑想、動植物の飼育", 1, "エルフ", "伊藤美来", 0, "コッコロ", 105901, 11, 35, "主を慕う、小さなガイド役");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 9, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 2, "美食殿", 152, "猫と遊ぶ", 1, "獣人族", "立花理香", 0, "キャル", 106001, 14, 39, "行き倒れの謎のネコミミ魔法使い");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 8, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", 11, "？？？", 148, "冒険、思い出話", "", "ヒューマン", "潘めぐみ", 0, "ムイミ", 106101, 16, 40, "さまよえる謎の少女");
