INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 3, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 31, "美食殿", 156, "食べ歩き、料理", 1, "ヒューマン", "M・A・O", 0, "ペコリーヌ（サマー）", 107501, 17, 46, "いつも元気な腹ペコ少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 5, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 11, "美食殿", 140, "瞑想、動植物の飼育", 1, "エルフ", "伊藤美来", 0, "コッコロ（サマー）", 107601, 11, 35, "主を慕う、小さなガイド役");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, "サレンディア救護院", 154, "ご奉仕", 9, "ヒューマン", "悠木碧", 0, "スズメ（サマー）", 107701, 15, 43, "お嬢さまのためにがんばるドジっ娘メイド");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 9, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 2, "美食殿", 152, "猫と遊ぶ", 1, "獣人族", "立花理香", 0, "キャル（サマー）", 107801, 14, 39, "行き倒れの謎のネコミミ魔法使い");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 1, "メルクリウス財団", 158, "猫とたわむれること", 12, "獣人族", "沼倉愛美", 0, "タマキ（サマー）", 107901, 18, 48, "弱きを助け強きをくじく猫娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "メルクリウス財団", 163, "傭兵などのアルバイト", 12, "ヒューマン", "田所あずさ", 0, "ミフユ（サマー）", 108001, 20, 49, "仕事も私事も効率優先な傭兵少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, "悪魔偽王国軍（ディアボロス）", 157, "占い", 7, "魔族", "大坪由佳", 0, "シノブ（ハロウィン）", 108101, 18, 42, "占いが得意な霊能少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, "悪魔偽王国軍（ディアボロス）", 130, "プリンを食べること", 7, "魔族", "雨宮天", 0, "ミヤコ（ハロウィン）", 108201, 14, 32, "プリン大好きゴースト娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 3, "ルーセント学院", 120, "ファッション誌鑑賞、コスメ集め", 14, "魔族", "久野美咲", 0, "ミサキ（ハロウィン）", 108301, 11, 22, "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, "カルミナ", 163, "各種楽器", 4, "ヒューマン", "福原綾香", 0, "チカ（クリスマス）", 108401, 17, 46, "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "サレンディア救護院", 150, "観劇、おままごと", 9, "ヒューマン", "植田佳奈", 0, "クルミ（クリスマス）", 108501, 12, 40, "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, "サレンディア救護院", 148, "屋内でできる遊び", 9, "ヒューマン", "芹澤優", 0, "アヤネ（クリスマス）", 108601, 14, 38, "ぷうきちといつも一緒！");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, "トゥインクルウィッシュ", 155, "人助け、応援", 2, "獣人族", "東山奈央", 0, "ヒヨリ（ニューイヤー）", 108701, 16, 44, "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, "トゥインクルウィッシュ", 158, "料理、人間観察", 2, "ヒューマン", "種田梨沙", 0, "ユイ（ニューイヤー）", 108801, 17, 47, "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, "トゥインクルウィッシュ", 163, "読書、乗馬、お茶", 2, "魔族", "早見沙織", 0, "レイ（ニューイヤー）", 108901, 18, 46, "クールで何事にも真っ直ぐな剣士");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, "トワイライトキャラバン", 154, "実験、裁縫、料理", 13, "魔族", "橋本ちなみ", 0, "エリコ（バレンタイン）", 109001, 16, 43, "運命の相手に一途すぎる乙女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 24, "ラビリンス", 168, "家事全般", 3, "ヒューマン", "生天目仁美", 0, "シズル（バレンタイン）", 109101, 18, 54, "お姉ちゃんがお世話してあげるからねっ！");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 12, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 1, "？？？", 156, "読書", "", "ヒューマン", "日笠陽子", 0, "アン", 109201, 17, 55, "英霊と契約を結んだマナリアの天才王女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 2, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 4, "？？？", 144, "食べること、眠ること", "", "ヒューマン", "こやまきみこ", 0, "ルゥ", 109301, 15, 45, "マナリア魔法学院の新入生");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 11, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 3, "？？？", 167, "ピアノ", "", "半人半竜", "福原綾香", 0, "グレア", 109401, 17, 67, "人を超越した力を有す心優しい竜姫");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 19, "ヴァイスフリューゲル　ランドソル支部", 157, "小説を読むこと", 15, "ヒューマン", "長妻樹里", 0, "クウカ（オーエド）", 109501, 18, 49, "妄想大好き！　ほんとは照れ屋な女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 31, "ヴァイスフリューゲル　ランドソル支部", 163, "忍法開発", 15, "ヒューマン", "佐藤聡美", 0, "ニノン（オーエド）", 109601, 16, 51, "トーゴクの神秘、オシエテクダサイ！");
