INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 22, "自警団（カォン）", 155, "空想、ぬいぐるみ集め", 10, "獣人族", "内田真礼", 0, "マホ（シンデレラ）", 116001, 16, 42, "マホマホ王国のプリンセス");
