INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, "カルミナ", 163, "各種楽器", 4, "ヒューマン", "福原綾香", 0, "チカ（サマー）", 117301, 17, 46, "人々を守るために歌う、唱喚士の少女");
