INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 3, "ルーセント学院", 120, "ファッション誌鑑賞、コスメ集め", 14, "魔族", "久野美咲", 0, "ミサキ（ステージ）", 121401, 11, 22, "ちょっとおませな恋に恋する女の子");
