INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("AB", 12, "", 6, "？？？", 149, "お散歩、お料理", "", "魔族", "釘宮理恵", 0, "ヴァンピィ", 122301, "??", 41, "けんぞくのご主人様");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, "トゥインクルウィッシュ", 155, "人助け、応援", 2, "獣人族", "東山奈央", 0, "ヒヨリ（サマー）", 122401, 16, 44, "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("B", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, "トゥインクルウィッシュ", 163, "読書、乗馬、お茶", 2, "魔族", "早見沙織", 0, "レイ（サマー）", 122501, 18, 46, "クールで何事にも真っ直ぐな剣士");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, "トゥインクルウィッシュ", 158, "料理、人間観察", 2, "ヒューマン", "種田梨沙", 0, "ユイ（サマー）", 122601, 17, 47, "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("A", 2, "", 2, "リトルリリカル", 118, "お勉強", 5, "エルフ", "小倉唯", 0, "キョウカ（サマー）", 122701, 8, 21, "礼儀正しくしっかり者のちびっ子優等生");
