INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("O", 4, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 3, "リトルリリカル", 117, "かわいいもの集め", 5, "獣人族", "日高里菜", 0, "ミミ（サマー）", 122901, 10, 21, "お歌もにんじんも、ウサギさんも大好き♪");
